            EXG  A,B    ; (As nature intended.)
            TFR  D,Y
            JSR  DELAY
            JMP  LOOPEND
WR_BANK1    LDA  ,X+
            LDB  ,X+
            LDE  #1
            JSR  OPL_WRITE
            JMP  LOOPEND
