            LDA  #$BD
            LDB  #$00
            LDE  #$01
            JSR  OPL_WRITE            
            RTS             ; ALL DONE.
; -----------------------------------------------------------------------------
; A = REG NUM, B = VALUE, E = OPL3 Bank Number (0,1)           
; -----------------------------------------------------------------------------
OPL_WRITE   CMPE #00
            BEQ  BANK0
BANK1       STA  OPL3_BASE+2
            NOP
            NOP
            NOP
            NOP
            NOP
            STB  OPL3_BASE+3
            NOP
            NOP
            NOP
            NOP
            NOP
            RTS
BANK0       STA  OPL3_BASE+0
            NOP
            NOP
            NOP
            NOP
            NOP
            STB  OPL3_BASE+1
            NOP
            NOP
            NOP
            NOP
            NOP
            RTS
; -----------------------------------------------------------------------------
; Wait the number of sample periods given in Y. The sample rate is 44100 Hz
; Inner loop is 81 counts, outer loop is Y
; -----------------------------------------------------------------------------
DELAY       LDB  #17
DLOOP       DECB
            BNE  DLOOP
            LEAY -1,Y
            BNE  DELAY
            RTS
